.section-container { /* Defined in Site CSS */
  display: grid;
  gap: 2rem;

  @media (min-width: 800px) {
    grid-template-columns: 3fr 2fr;
    gap: 14rem;
  }
}

.content {
  display: grid;
  place-content: flex-start;
  gap: 1rem;

  .social-links {
    display: grid;
    gap: 0.5rem;

    a {
      display: flex;
      align-items: center;
      gap: 0.75rem;

      .icon {
        font-size: 1.25rem;
        color: var(--color-accent, rebeccapurple);
        transition: var(--transition, 0.1s transform);
      }

      &:hover .icon {
        transform: scale(1.1);
      }
    }
  }
}

form {
  display: grid;
  gap: 1rem;
  padding: 2rem;
  border: 1px solid var(--border-color, #eee);
  border-radius: var(--border-radius);

  label {
    display: grid;
    gap: 0.25rem;

    span {
      font-size: 0.75rem;
      font-weight: 500;
    }

    input,
    textarea {
      padding: 0.5rem;
      outline-color: transparent;
      transition: var(--transition, 0.1s outline-color);
      border: 1.5px solid var(--border-color, #eee);
      border-radius: var(--border-radius);

      &:focus {
        outline-color: var(--color-accent, rebeccapurple);
      }
    }
  }

  .button { /* Defined in Site CSS */
    margin-top: 1rem;
  }
}

.content {
  :global(img) {
    width: 100%;
    margin: 2rem 0;
    box-shadow: var(--box-shadow);
    border-radius: var(--border-radius);
  }

  :global(p) {
    padding: 0.5rem 0;
    line-height: 1.5;
  }

  :global(a) {
    text-decoration: underline;
  }

  :global(h1) {
    font-size: 2.5rem;
    font-weight: 600;
    line-height: 1.2;
    margin-bottom: 0.5rem;
  }

  :global(h2) {
    font-size: 2rem;
    font-weight: 600;
    margin-bottom: 0.25rem;
    line-height: 1.2;
  }

  :global(h3) {
    font-size: 1.5rem;
    font-weight: 600;
    line-height: 1.2;
    margin-top: .5rem;
  }

  :global(ul) {
    list-style: disc;
    padding: 0.5rem 0;
    padding-left: 1.25rem;
  }

  :global(ol) {
    list-style: decimal;
    padding: 0.5rem 0;
    padding-left: 1.25rem;
  }

  :global(blockquote) {
    padding: 2rem;
    box-shadow: var(--box-shadow);
    border-radius: var(--border-radius);
  }
}

.section-container { /* Defined in Site CSS */
  display: flex;
  justify-content: space-between;
  flex-direction: column;
  align-items: center;
  gap: 1rem;
  padding-top: 1rem;
  padding-bottom: 1rem;

  @media (min-width: 600px) {
    flex-direction: row;
  }
}

nav {
  display: flex;
  gap: 1rem;

  .link { /* Defined in Site CSS */
    border-color: transparent;

    &:hover {
      border-color: initial;
    }
  }
}

.primo {
  font-weight: 600;
  font-size: 0.75rem;

  a {
    text-decoration: underline; 
  }
}

.social-links {
  display: flex;
  gap: 1.5rem;
  font-size: 1.5rem;

  a {
    color: var(--color-accent, rebeccapurple);
    transition: var(--transition, 0.1s transform);

    &:hover {
      transform: scale(1.1);
    }
  }
}

